  final int code;
  final int r;
  final int g;
  final int b;
  final double luminance;
  final double contrastOnWhite;
  final double contrastOnBlack;

  const XtermColor({
    required this.code,
    required this.r,
    required this.g,
    required this.b,
    required this.luminance,
    required this.contrastOnWhite,
    required this.contrastOnBlack,
  });

  /// Calculate color distance using CIEDE2000.
  ///
  /// Returns perceptual color difference (ΔE).
  static double distance(XtermColor a, XtermColor b) {
    // Convert RGB to Lab
    final lab1 = _rgbToLab(a.r, a.g, a.b);
    final lab2 = _rgbToLab(b.r, b.g, b.b);
    return _ciede2000(lab1, lab2);
  }

  static (double L, double a, double b) _rgbToLab(int r, int g, int b) {
    // RGB to XYZ
    double pivotRgb(double n) {
      final v = n / 255.0;
      return v > 0.04045 ? math.pow((v + 0.055) / 1.055, 2.4).toDouble() : v / 12.92;
    }
    final rLinear = pivotRgb(r.toDouble()) * 100;
    final gLinear = pivotRgb(g.toDouble()) * 100;
    final bLinear = pivotRgb(b.toDouble()) * 100;

    // Observer = 2°, Illuminant = D65
    final x = rLinear * 0.4124564 + gLinear * 0.3575761 + bLinear * 0.1804375;
    final y = rLinear * 0.2126729 + gLinear * 0.7151522 + bLinear * 0.0721750;
    final z = rLinear * 0.0193339 + gLinear * 0.1191920 + bLinear * 0.9503041;

    // XYZ to Lab
    const refX = 95.047;
    const refY = 100.000;
    const refZ = 108.883;

    double pivotXyz(double n) {
      return n > 0.008856 ? math.pow(n, 1.0 / 3.0).toDouble() : (7.787 * n) + (16.0 / 116.0);
    }

    final xPivot = pivotXyz(x / refX);
    final yPivot = pivotXyz(y / refY);
    final zPivot = pivotXyz(z / refZ);

    final labL = (116.0 * yPivot) - 16.0;
    final labA = 500.0 * (xPivot - yPivot);
    final labB = 200.0 * (yPivot - zPivot);

    return (labL, labA, labB);
  }

  static double _ciede2000(
    (double, double, double) lab1,
    (double, double, double) lab2,
  ) {
    final l1 = lab1.$1;
    final a1 = lab1.$2;
    final b1 = lab1.$3;
    final l2 = lab2.$1;
    final a2 = lab2.$2;
    final b2 = lab2.$3;

    const kL = 1.0;
    const kC = 1.0;
    const kH = 1.0;
    const pi = 3.141592653589793;

    final c1 = math.sqrt(a1 * a1 + b1 * b1);
    final c2 = math.sqrt(a2 * a2 + b2 * b2);
    final cBar = (c1 + c2) / 2;

    final cBar7 = cBar * cBar * cBar * cBar * cBar * cBar * cBar;
    final g = 0.5 * (1 - math.sqrt(cBar7 / (cBar7 + 6103515625)));

    final a1Prime = a1 * (1 + g);
    final a2Prime = a2 * (1 + g);

    final c1Prime = math.sqrt(a1Prime * a1Prime + b1 * b1);
    final c2Prime = math.sqrt(a2Prime * a2Prime + b2 * b2);

    var h1Prime = math.atan2(b1, a1Prime) * 180 / pi;
    if (h1Prime < 0) h1Prime += 360;
    var h2Prime = math.atan2(b2, a2Prime) * 180 / pi;
    if (h2Prime < 0) h2Prime += 360;

    final deltaLPrime = l2 - l1;
    final deltaCPrime = c2Prime - c1Prime;

    double deltahPrime;
    if (c1Prime * c2Prime == 0) {
      deltahPrime = 0;
    } else {
      final diff = h2Prime - h1Prime;
      if (diff.abs() <= 180) {
        deltahPrime = diff;
      } else if (diff > 180) {
        deltahPrime = diff - 360;
      } else {
        deltahPrime = diff + 360;
      }
    }

    final deltaHPrime =
        2 * math.sqrt(c1Prime * c2Prime) * math.sin(deltahPrime * pi / 360);

    final lBarPrime = (l1 + l2) / 2;
    final cBarPrime = (c1Prime + c2Prime) / 2;

    double hBarPrime;
    if (c1Prime * c2Prime == 0) {
      hBarPrime = h1Prime + h2Prime;
    } else if ((h1Prime - h2Prime).abs() <= 180) {
      hBarPrime = (h1Prime + h2Prime) / 2;
    } else if (h1Prime + h2Prime < 360) {
      hBarPrime = (h1Prime + h2Prime + 360) / 2;
    } else {
      hBarPrime = (h1Prime + h2Prime - 360) / 2;
    }

    final t = 1 -
        0.17 * math.cos((hBarPrime - 30) * pi / 180) +
        0.24 * math.cos(2 * hBarPrime * pi / 180) +
        0.32 * math.cos((3 * hBarPrime + 6) * pi / 180) -
        0.20 * math.cos((4 * hBarPrime - 63) * pi / 180);

    final deltaTheta =
        30 * math.exp(-((hBarPrime - 275) / 25) * ((hBarPrime - 275) / 25));

    final cBarPrime7 =
        cBarPrime * cBarPrime * cBarPrime * cBarPrime * cBarPrime * cBarPrime * cBarPrime;
    final rc = 2 * math.sqrt(cBarPrime7 / (cBarPrime7 + 6103515625));

    final lBarPrimeMinus50Sq = (lBarPrime - 50) * (lBarPrime - 50);
    final sl =
        1 + (0.015 * lBarPrimeMinus50Sq) / math.sqrt(20 + lBarPrimeMinus50Sq);
    final sc = 1 + 0.045 * cBarPrime;
    final sh = 1 + 0.015 * cBarPrime * t;
    final rt = -math.sin(2 * deltaTheta * pi / 180) * rc;

    final dL = deltaLPrime / (kL * sl);
    final dC = deltaCPrime / (kC * sc);
    final dH = deltaHPrime / (kH * sh);

    return math.sqrt(dL * dL + dC * dC + dH * dH + rt * dC * dH);
  }
